import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import './index.css'

const name= "shafayet";
const id= "12";
const dept= "CS";

function Userlist(){
    return(
        <div>
            <User/>
            <User name={name} id={id} dept={dept} />
            <User/>
        </div> 

        
    )
};

function User(props){

    // const name= "shafayet";
    // const id= "12";
    // const dept= "CS";

    return(
        <div className='usermain'>
         <h1> Name: {props.name}</h1>
         <p>  ID:  {props.id}</p>
         <p>  Dept:  {props.dept} </p>
        </div>  
    )
};

